INSERT INTO `health_assessment` VALUES (7, '李真欣', '210102197204294549', '1972-04-29', 53, 0, '30.0', 'risk', 1, '特技护理等级', 1, '2023-10-10', '大健康', 'https://luruoyang.oss-cn-hangzhou.aliyuncs.com/1/1/15/15/3/0/13/6/体检报告-张芳-女-72岁.pdf', '2025-07-28 21:28:18', '体检报告中尿蛋白、血红蛋白、血压、总胆固醇、甘油三酯、低密度脂蛋白胆固醇、乙肝表面抗体、脾脏大小、右肾囊肿共9项指标提示异常，尿液常规共1项指标处于临界值，血脂、血液常规、尿液常规、糖类抗原、血清酶类等共43项指标提示正常，综合这些临床指标和数据分析：肾脏、肝胆、心脑血管存在隐患，其中心脑血管有“高危”风险；肾脏部位有“中危”风险；肝胆部位有“低危”风险。', '{\"healthy\":30,\"caution\":40,\"risk\":20,\"danger\":10,\"severeDanger\":0}', '[{\"conclusion\":\"双下肢轻微凹陷性水肿\",\"examinationItem\":\"内科检查\",\"result\":\"双下肢轻微凹陷性水肿\",\"referenceValue\":\"无\",\"unit\":\"-\",\"interpret\":\"双下肢轻微凹陷性水肿可能提示心肾功能不全，也可能与长时间站立、久坐或静脉回流不畅有关。\",\"advice\":\"建议进行心肾功能检查，避免长时间站立或久坐，适当抬高下肢促进静脉回流。\"},{\"conclusion\":\"视力下降\",\"examinationItem\":\"眼科检查\",\"result\":\"视力左0.5，视力右0.6\",\"referenceValue\":\"正常视力通常高于1.0\",\"unit\":\"-\",\"interpret\":\"视力下降可能与年龄增长、用眼过度或眼部疾病有关。\",\"advice\":\"建议定期复查视力，并考虑配戴老花镜以改善视力。同时，注意用眼卫生，避免长时间用眼。\"},{\"conclusion\":\"右耳听力下降\",\"examinationItem\":\"耳鼻喉科检查\",\"result\":\"听力右下降\",\"referenceValue\":\"正常听力\",\"unit\":\"-\",\"interpret\":\"右耳听力下降可能与年龄增长、耳部疾病或噪音暴露有关。\",\"advice\":\"建议耳鼻喉科进一步评估听力下降的原因，并采取相应治疗措施。同时，注意保护听力，避免长时间暴露于噪音环境中。\"},{\"conclusion\":\"血压偏高\",\"examinationItem\":\"一般科室检查\",\"result\":\"收缩压145 mmHg，舒张压90 mmHg\",\"referenceValue\":\"收缩压<140 mmHg，舒张压<90 mmHg\",\"unit\":\"mmHg\",\"interpret\":\"血压偏高可能增加心血管疾病的风险。\",\"advice\":\"建议定期监测血压，保持健康的生活方式，如低盐饮食、适量运动、戒烟限酒等。必要时，心内科随访并考虑药物治疗。\"},{\"conclusion\":\"血红蛋白略低\",\"examinationItem\":\"血常规检查\",\"result\":\"血红蛋白110 g/l\",\"referenceValue\":\"120-160 g/l\",\"unit\":\"g/l\",\"interpret\":\"血红蛋白略低可能提示贫血，可能与营养摄入不足、慢性疾病或失血有关。\",\"advice\":\"建议增加铁质摄入，如多吃瘦肉、动物肝脏、绿叶蔬菜等。同时，定期复查血常规，关注血红蛋白水平变化。\"},{\"conclusion\":\"尿蛋白微量\",\"examinationItem\":\"尿常规检查\",\"result\":\"尿蛋白（PRO）微量\",\"referenceValue\":\"阴性\",\"unit\":\"-\",\"interpret\":\"尿蛋白微量可能提示肾脏功能受损，也可能与剧烈运动、发热或药物影响有关。\",\"advice\":\"建议复查尿常规，关注尿蛋白水平变化。同时，注意保护肾脏，避免使用肾毒性药物，保持健康的生活方式。\"},{\"conclusion\":\"胆固醇及低密度脂蛋白略高\",\"examinationItem\":\"生化检查\",\"result\":\"总胆固醇6.2 mmol/L，低密度脂蛋白4.0 mmol/L\",\"referenceValue\":\"总胆固醇2.3-5.7 mmol/L，低密度脂蛋白2.1-3.1 mmol/L\",\"unit\":\"mmol/L\",\"interpret\":\"胆固醇及低密度脂蛋白略高可能增加心血管疾病的风险。\",\"advice\":\"建议饮食控制，减少高胆固醇食物摄入，如动物内脏、蛋黄等。同时，增加运动量，保持健康的生活方式。必要时，考虑药物治疗。\"},{\"conclusion\":\"乙肝表面抗体阴性\",\"examinationItem\":\"免疫检查\",\"result\":\"乙肝表面抗体阴性\",\"referenceValue\":\"阴性/阳性\",\"unit\":\"-\",\"interpret\":\"乙肝表面抗体阴性表示对乙肝病毒无免疫力，易感染乙肝病毒。\",\"advice\":\"建议接种乙肝疫苗以产生免疫力，预防乙肝病毒感染。\"},{\"conclusion\":\"脾轻度增大\",\"examinationItem\":\"B超检查\",\"result\":\"脾轻度增大\",\"referenceValue\":\"正常大小\",\"unit\":\"-\",\"interpret\":\"脾轻度增大可能与感染、血液系统疾病或肝脏疾病有关。\",\"advice\":\"建议进一步检查以明确脾增大的原因，并采取相应治疗措施。\"},{\"conclusion\":\"右肾小囊肿可能\",\"examinationItem\":\"B超检查\",\"result\":\"右肾下极见一大小约5mm的无回声区，考虑小囊肿可能\",\"referenceValue\":\"无囊肿\",\"unit\":\"-\",\"interpret\":\"右肾小囊肿可能为良性病变，但需进一步检查以明确性质。\",\"advice\":\"建议进一步检查以明确囊肿的性质和大小，必要时考虑手术治疗。\"}]', '{\"breathingSystem\":90,\"digestiveSystem\":85,\"endocrineSystem\":75,\"immuneSystem\":80,\"circulatorySystem\":65,\"urinarySystem\":70,\"motionSystem\":90,\"senseSystem\":75}', '1', '2025-07-28 21:28:18', NULL, NULL, NULL);
